import React, { useState, useEffect } from "react";
import "./App.css";
import { Container, Button } from "reactstrap";

const App = () => {
  const [algo, setAlgo] = useState(true);
  const toggle = () => {
    setAlgo(!algo);
  };
  useEffect(() => {
    console.log(algo);
  }, [algo]);
  return (
    <Container>
      <Button onClick={() => toggle()}>{algo}</Button>
      <h1>
        <h2>
          <h6>
            <p>Wenas</p>
          </h6>
        </h2>
      </h1>
    </Container>
  );
};

export default App;
